import React from 'react';
import Rainbow from '../hoc/Rainbow';
import './Watches.css';



const Necklaces = (props) => {
	// console.log(props);
	// setTimeout(() => {
	// 	  props.history.push("/about");
	// 	}, 2000);

	return (
		<div>
			<div className="container">
				<h4 className="center">Necklaces</h4>
                <div className='nnn'><img src={require("./kolimg/1k.jpg")} >
                <div className="ui vertical animated button" tabindex="0">
                <div className="hidden content">Shop</div>
                <div className="visible content">
                    <i className="shop icon"></i>
                </div>
                </div>
                </img>
                 </div>
                <div className='nnn'><img src={require("./kolimg/2k.jpg")}></img></div>
                <div className='nnn'><img src={require("./kolimg/3k.jpg")}></img></div>
                <div className='nnn'><img src={require("./kolimg/4k.jpeg")}></img></div>
                <div className='nnn'><img src={require("./kolimg/5k.jpeg")}></img></div>
                <div className='a'><button className="btn grey">
						Sepete Ekle
					</button></div>
				
			</div>
            
		</div>
	)
}


export default Rainbow(Necklaces);
